import "./style.css";

function App() {
  return (
    <>
      {/* HEADER */}
      <header className="header">
        <div className="logo">
          <img
            src="logo.png"
            height="68"
            width="68"
            alt="Today's Latte Art Logo"
          />
          <h1>Today's Latte Art</h1>
        </div>
        <button className="btn btn-large btn-post">Share a picture</button>
      </header>

      <NewArtForm />
      <main className="main">
        <NewArtForm />
        <CategoryFilter />
      </main>
    </>
  );
}

function NewArtForm() {
  return <form className="art-form">Art form</form>;
}

function CategoryFilter() {
  return <aside>Category filter</aside>;
}

function ArtList() {
  return <section>Art list</section>;
}

export default App;
